import React from 'react';
import styled from 'styled-components';

const Styles=styled.p`
  	.para{
		background:rgba(170, 14, 14, 0.59);
		text-align:center;
		font:1em 'Lobster';
		border-radius:2px 0;
	}


	@media screen and (max-width: 600px) {
		background:rgba(170, 14, 14, 0.59);
		text-align:center;
		font:1em 'Lobster';


	}

	}
`
function Contact() {
	return(
		<div className='mast'>
		<div className='title'>Let’s Be Friends!</div>
		<Styles>
		<p className='para'>
			I love connecting with people and building real communities with real human beings. So, if you have room for one more friend, here’s where you can find me…
		</p>
		</Styles>
		</div>

		);
}

export default Contact;
